import user from '../user.json';
import { UserProfile } from './UserProfile/UserProfile';
import { Statistics } from './Statistics/Statistics';
export const App = () => {
  return (
    <div>
      <UserProfile
        username={user.username}
        tag={user.tag}
        location={user.location}
        avatar={user.avatar}
        stats={user.stats}
      />
    </div>
  );
};
